import './App.css';
import HomePage from "./Components/HomePage";
import EmployeePage from './Components/EmployeePage';
import Wrapper from './Components/Wrapper';
import ImageOne from './assets/Images/Image_one.jpeg';
import ImageTwo from './assets/Images/Image_two.jpeg';
import ImageThree from './assets/Images/Image_three.jpeg';



function App () { 
  const employees = [
    {
      id: 1,
    image: ImageOne,
    name: "john Doe",
    title: "Front End Developer",
    },
    {
      id: 2,
      image: ImageTwo,
      name: "john Doe",
      title: "Front End Developer",
      },
      {
        id: 3,
        image: ImageThree,
        name: "john Doe",
        title: "Front End Developer",
        },
  ];
  return (
    <div className='App'>
      <Wrapper>
          <HomePage employees={employees}/>
          <EmployeePage employees = {employees}/>
          <ImageOne/>
          <ImageTwo/>
          <ImageThree/>
          </Wrapper>

    </div>
  );
    }

export default App;
